import React from 'react'
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
        main: '#ff79c6',
    },
    text: {
        primary: "#ffff",
        secondary: "#ffff",
      },
  },
});



  

export default function InputAndReturn() {

    function clickLog(){
        console.log('click')
    }

  return (
    
    <>
    <form className='inputField'>
    <ThemeProvider theme={theme}>
    <TextField onClick={clickLog} className="input" id="filled-basic" label="Add ToDo..." variant="filled" color="primary" inputProps={{ style: { color: "#ff79c6" } }}/>
      <Button variant="contained" size='large'>+</Button>
    </ThemeProvider>
    </form>
    </>

  )
}
